import React, { useState, useEffect } from 'react';
import './Grid.css';
import NumberSquare from './NumberSquare';

const Grid = (props) => {

    let size = props.size;

    const [arr, setArr] = useState([])

    for (let i = 2; i < size; i++) {
        setArr(old => [...old, i]);
    }

    if (props.start) {
        setArr(arr.map((item, index) => <NumberSquare number={5} />))
    }

    return (
        <div className="Grid">
            {arr.map((item, index) => <NumberSquare number={item} />)}
        </div>
    )

}

export default Grid;
